import "./App.css";
import React, { useState } from "react";
import axios from "axios";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";

function App() {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");

  async function registrUser() {
    let result = await axios("/register", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        username,
        password,
      }),
    });
    result = await result.JSON();
    console.log(result);
  }

  function handleSubmit(e) {
    console.log(
      "A name was submitted:" + JSON.stringify({ name: this.state.value })
    );
    fetch("/name", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({ name: this.state.value }),
    })
      .then((res) => res.json())
      .then((response) => alert("Success:", JSON.stringify(response)))
      .catch((error) => console.log("Error:", error));
  }

  return (
    <>
      <h1>Registration</h1>
      <form onSubmit={(event) => event.preventDefult()}>
        <input
          type="text"
          placeholder="Username"
          onChange={(e) => {
            setUsername(e.target.value);
          }}
        ></input>

        <input
          type="password"
          placeholder="Password"
          onChange={(e) => {
            setPassword(e.target.value);
          }}
        ></input>

        <button type="submit" onClick={registrUser}>
          Register
        </button>
      </form>

      <Form id="formName" onSubmit={this.handleSubmit}>
        <Form.Group>
          <Form.Label>Enter your name:</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter name"
            id="name"
            name="name"
            onChange={this.handleChange}
          />
        </Form.Group>
        <Button variant="primary" type="submit">
          Submit
        </Button>
      </Form>
    </>
  );
}

export default App;
